import React from "react";
import "./css/demo.css";
import "./css/normalize.css";
import "./css/component.css";
import {Helmet} from "react-helmet";

function Menu() {
  return (
    <div style={{background:"red"}}>
      <Helmet>
      <script src="js/segment.min.js"></script>
    <script src="js/ease.min.js"></script>
      </Helmet>
    <div id="menu-icon-wrapper" className="menu-icon-wrapper" style={{visibility:
			"hidden"}}>
        <svg   style={{height:"1000px",width:"1000px"}}>
				<path id="pathA" d="M 300 400 L 700 400 C 900 400 900 750 600 850 A 400 400
					0 0 1 200 200 L 800 800"></path>
				<path id="pathB" d="M 300 500 L 700 500"></path>
				<path id="pathC" d="M 700 600 L 300 600 C 100 600 100 200 400 150 A 400 380
					0 1 1 200 800 L 800 200"></path>
			</svg>
        <button id="menu-icon-trigger" className="menu-icon-trigger" style={{float:"right"}}></button>
    </div>
    {/* <!-- menu-icon-wrapper --> */}
    <div id="dummy" className="dummy">
        <div className="dummy__item">Home</div>
        <div className="dummy__item">About</div>
        <div className="dummy__item"></div>
        <div className="dummy__item"></div>
    </div>
    <Helmet>
    <script src="js/main.js"></script>

    </Helmet>
    </div>
  );
}

export default Menu;
